import React ,{ Component }from "react";
import PageHelmet from "../component/common/Helmet";
import Breadcrumb from "../elements/common/Breadcrumb";
import ScrollToTop from 'react-scroll-up';
import Header from "../component/header/Header";
import Footer from "../component/footer/Footer";
import { FiChevronUp } from "react-icons/fi";

const LinkTreeList = [
    {
        title: 'Resume',
        href: 'graphic-design-details'
    },
    {
        title: 'Mobile App Design',
        href: 'mobile-app-details'
    }, 
    {
        title: 'Social Medias',
        href: '#social-media'
    }, 
    {
        title: 'Social Medias',
        href: '#social-media'
    }

]


class LinkTree extends Component{
    render(){
        const {column } = this.props;
        const LinkTreeContent = LinkTreeList.slice(0 , this.props.item);

        return(
            <React.Fragment>
                <PageHelmet pageTitle='LinkTree' />
                <Header headertransparent="header--transparent" colorblack="color--black" logoname="logo.png" />

                {/* Start Breadcrump Area */}
                <Breadcrumb title={'LinkTree'}   />
                {/* End Breadcrump Area */}

                {/* Start LinkTree */}
                <div className="row">
                    {LinkTreeContent.map( (val , i) => (
                        <div className={`${column}`} key={i}>
                            <a href={`${val.href}`}>
                                <div className="service service__style--2">
                                    <div className="content">
                                        <h3 className="title" style={{color: "#000073"}}>{val.title}</h3>
                                    </div>
                                </div>
                            </a>
                        </div>
                    ))}
                </div>
                 {/* End LinkTree */}

                {/* Start Back To Top */}
                <div className="backto-top">
                    <ScrollToTop showUnder={160}>
                        <FiChevronUp />
                    </ScrollToTop>
                </div>
                {/* End Back To Top */}

                <Footer />

            </React.Fragment>
        )
    }
}
export default LinkTree;
